import React,{useState,useEffect} from 'react';
import { 
    StyleSheet,
    Text, 
    View,
    Alert,
    ScrollView,
    TouchableOpacity
    } from 'react-native';
import {TextInput,Button} from 'react-native-paper'
import DateTimePicker from '@react-native-community/datetimepicker';
import { MaterialIcons,AntDesign,FontAwesome } from '@expo/vector-icons';
import {Collapse,CollapseHeader, CollapseBody} from 'accordion-collapse-react-native';

const ManageConsultation = ({navigation,route})=>{

  const getDetails = (type) =>{
       if(route.params){
          switch(type){
             case "first_name":
                  return route.params.first_name
              case "doctorId":
                  return route.params._id
          }
       }
         return ""
    }


    const GetParams = () =>{
      setdoctorName(getDetails("first_name"))
      setdoctorId(getDetails("doctorId"))
      console.log(doctorName)
    }
    
  
   // const [date, setDate] = useState(new Date(1598051730000));
    const [mode, setMode] = useState('date');
    const [show, setShow] = useState(false);

    const [doctorId,setdoctorId] = useState(getDetails("doctorId"))
    const [doctorName,setdoctorName] = useState(getDetails("first_name"))
    const [starttime,setStarttime] = useState("")
    const [endtime,setEndtime] = useState("")
    const [Dayfrom,setDayfrom] = useState("")
    const [Dayto,setDayto] = useState("")
    const [slotduration,setSlotDuration] = useState("")
    

    useEffect(()=>{
       
      const unsubscribe = navigation.addListener('focus', () => {

          // The screen is focused
    
          // Call any action
          setdoctorName(route.params.first_name)
          setdoctorId(route.params._id)
          setStarttime("")
          setEndtime("")
          setDayfrom("")
          setDayto("")
          setSlotDuration("")
          

      //    setTimeout(() => {
            
          
      //    }, 5000); 
         console.log(route.params)
          });
          
           
          
          // Return the function to unsubscribe from the event so it gets removed on unmount
          
          return unsubscribe;
    
      },[route.params])

  
    const updateDetails = ()=>{
        fetch("http://mconnecthealth.com:2000/insert_consultation",{
            method:"post",
            headers:{
              'Content-Type': 'application/json'
            },
            body:JSON.stringify({
              doctorId,
              Dayfrom,
              Dayto,
              starttime,
              endtime,
              slotduration,
             
            })
        })
        .then(res=>res.json())
        .then(data=>{
            Alert.alert(`${doctorName} is updated successfully`)
            navigation.navigate("Doctors")
        })
        .catch(err=>{
          Alert.alert("something went wrong")
      })
    }

    const onChangeStart = (event, selectedDate) => {
        const currentDate = selectedDate || starttime;
        setShow(Platform.OS === 'ios');
        setStarttime(currentDate);
        console.log(starttime)
      };

  

      const onChangeEnd = (event, selectedDate) => {
        const currentDate = selectedDate || endtime;
        setShow(Platform.OS === 'ios');
        setEndtime(currentDate);
        console.log(endtime)
      };


      const onChangeDate = (event, selectedDate) => {
        const currentDate = selectedDate || date;
        setShow(Platform.OS === 'ios');
        setdate(currentDate);
        console.log(date)
      };
     
      const showMode = currentMode => {
        setShow(true);
        setMode(currentMode);
      };
     
      const showDatepicker = () => {
        showMode('date');
      };
     
      const showTimepicker = () => {
        showMode('time');
      };

  //     useEffect(()=>{
  //       GetParams()
  //  },[])

    return(

        <View style={styles.container}>

        <View style={styles.head}> 
        <MaterialIcons 
                        name="navigate-before"
                        size={40}
                        onPress={() => navigation.goBack() }
                        style={styles.back}/>

              <Text style={styles.headtext}>Manage Consultation</Text>
        </View>
        <View style={styles.headtitle}> 
        <Text style={styles.Title}>{doctorName}</Text>    
        </View>
        

        <ScrollView style={styles.formArea}>
        <View style={{width:'100%',flexDirection:'row'}}>
            <View style={styles.Days}>
                  <Collapse>
                    <CollapseHeader>
                    <View style={{flexDirection:'row', justifyContent:'center',alignItems:'center'}}>
                    <TextInput
                        label='Day From'
                        placeholderTextColor="#666666"
                        style={styles.inputStyle}
                        value={Dayfrom}
                        theme={theme}
                        mode="outlined"
                        onChangeText={text =>setDayfrom(text)}
                    />
                    <View style={{width:'20%',backgroundColor:'lightgrey',padding:8,marginEnd:2}}>
                          <AntDesign name="down" size={24} color="blue" />
                    </View> 
                    </View>
                      </CollapseHeader>
                            <CollapseBody style={{marginLeft:15}}>
                                  <TouchableOpacity onPress={() => setDayfrom("Monday")}><Text style={styles.option}>Monday</Text></TouchableOpacity> 
                                  <TouchableOpacity onPress={() => setDayfrom("Tuesday")}><Text style={styles.option}>Tuesday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayfrom("Wednesday")}><Text style={styles.option}>Wednesday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayfrom("Thursday")}><Text style={styles.option}>Thursday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayfrom("Friday")}><Text style={styles.option}>Friday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayfrom("Saturday")}><Text style={styles.option}>Saturday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayfrom("Sunday")}><Text style={styles.option}>Sunday</Text></TouchableOpacity>
                              </CollapseBody>
                    
                    
                    </Collapse>

            </View>
            <View style={styles.Days}>
                  <Collapse>
                    <CollapseHeader>
                    <View style={{flexDirection:'row', justifyContent:'center',alignItems:'center'}}>
                    <TextInput
                        label='Day To'
                        placeholderTextColor="#666666"
                        style={styles.inputStyle}
                        value={Dayto}
                        theme={theme}
                        mode="outlined"
                        onChangeText={text =>setDayto(text)}
                      
                    />
                    <View style={{width:'20%',backgroundColor:'lightgrey',padding:8,marginEnd:2}}>
                          <AntDesign name="down" size={24} color="blue" />
                    </View> 
                    </View>
                      </CollapseHeader>
                            <CollapseBody style={{marginLeft:15}}>
                                  <TouchableOpacity onPress={() => setDayto("Monday")}><Text style={styles.option}>Monday</Text></TouchableOpacity> 
                                  <TouchableOpacity onPress={() => setDayto("Tuesday")}><Text style={styles.option}>Tuesday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayto("Wednesday")}><Text style={styles.option}>Wednesday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayto("Thursday")}><Text style={styles.option}>Thursday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayto("Friday")}><Text style={styles.option}>Friday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayto("Saturday")}><Text style={styles.option}>Saturday</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setDayto("Sunday")}><Text style={styles.option}>Sunday</Text></TouchableOpacity>
                              </CollapseBody>
                    
                    
                    </Collapse>

            </View>
            
         </View>

         <View style={{width:'100%',flexDirection:'row'}}>
            <View style={styles.Days}>
                  <Collapse>
                    <CollapseHeader>
                    <View style={{flexDirection:'row', justifyContent:'center',alignItems:'center'}}>
                    <TextInput
                        label='Start Time'
                        placeholderTextColor="#666666"
                        style={styles.inputStyle}
                        value={starttime}
                        theme={theme}
                        mode="outlined"
                        onChangeText={text =>setStarttime(text)}
                    />
                    <View style={{width:'20%',backgroundColor:'lightgrey',padding:8,marginEnd:2}}>
                          <AntDesign name="down" size={24} color="blue" />
                    </View> 
                    </View>
                      </CollapseHeader>
                            <CollapseBody style={{marginLeft:15}}>
                                  <TouchableOpacity onPress={() => setStarttime("09:00 AM")}><Text style={styles.option}>09:00 AM</Text></TouchableOpacity> 
                                  <TouchableOpacity onPress={() => setStarttime("10:00 AM")}><Text style={styles.option}>10:00 AM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setStarttime("11:00 AM")}><Text style={styles.option}>11:00 AM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setStarttime("12:00 PM")}><Text style={styles.option}>12:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setStarttime("01:00 PM")}><Text style={styles.option}>01:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setStarttime("02:00 PM")}><Text style={styles.option}>02:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setStarttime("03:00 PM")}><Text style={styles.option}>03:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setStarttime("04:00 PM")}><Text style={styles.option}>04:00 PM</Text></TouchableOpacity>
                              </CollapseBody>
                    
                    
                    </Collapse>

            </View>
            <View style={styles.Days}>
                  <Collapse>
                    <CollapseHeader>
                    <View style={{flexDirection:'row', justifyContent:'center',alignItems:'center'}}>
                    <TextInput
                        label='End Time'
                        placeholderTextColor="#666666"
                        style={styles.inputStyle}
                        value={endtime}
                        theme={theme}
                        mode="outlined"
                        onChangeText={text =>setEndtime(text)}
                      
                    />
                    <View style={{width:'20%',backgroundColor:'lightgrey',padding:8,marginEnd:2}}>
                          <AntDesign name="down" size={24} color="blue" />
                    </View> 
                    </View>
                      </CollapseHeader>
                            <CollapseBody style={{marginLeft:15}}>
                                  <TouchableOpacity onPress={() => setEndtime("10:00 AM")}><Text style={styles.option}>10:00 AM</Text></TouchableOpacity> 
                                  <TouchableOpacity onPress={() => setEndtime("11:00 AM")}><Text style={styles.option}>11:00 AM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("12:00 PM")}><Text style={styles.option}>12:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("01:00 PM")}><Text style={styles.option}>01:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("02:00 PM")}><Text style={styles.option}>02:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("03:00 PM")}><Text style={styles.option}>03:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("04:00 PM")}><Text style={styles.option}>04:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("05:00 PM")}><Text style={styles.option}>05:00 PM</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setEndtime("06:00 PM")}><Text style={styles.option}>06:00 PM</Text></TouchableOpacity>
                              </CollapseBody>
                    
                    
                    </Collapse>

            </View>
            
         </View>
          
         <View style={styles.Days}>
                  <Collapse>
                    <CollapseHeader>
                    <View style={{flexDirection:'row', justifyContent:'center',alignItems:'center'}}>
                    <TextInput
                        label='Slot Duration'
                        placeholderTextColor="#666666"
                        style={styles.inputStyle}
                        value={slotduration}
                        theme={theme}
                        mode="outlined"
                        onChangeText={text =>setSlotDuration(text)}
                      
                    />
                    <View style={{width:'20%',backgroundColor:'lightgrey',padding:8,marginEnd:2}}>
                          <AntDesign name="down" size={24} color="blue" />
                    </View> 
                    </View>
                      </CollapseHeader>
                            <CollapseBody style={{marginLeft:15}}>
                                  <TouchableOpacity onPress={() => setSlotDuration("10")}><Text style={styles.option}>10</Text></TouchableOpacity> 
                                  <TouchableOpacity onPress={() => setSlotDuration("15")}><Text style={styles.option}>15</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setSlotDuration("20")}><Text style={styles.option}>20</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setSlotDuration("30")}><Text style={styles.option}>30</Text></TouchableOpacity>
                                  <TouchableOpacity onPress={() => setSlotDuration("60")}><Text style={styles.option}>60</Text></TouchableOpacity>
                                  
                            </CollapseBody>
                    
                    
                    </Collapse>

            </View>
        
           
             <Button 
             style={styles.btn}
             icon="content-save"
              mode="contained" 
              theme={theme}
              onPress={() => updateDetails()}>
                   Save 
             </Button>
             <Button 
             style={styles.cancelbtn}
             icon="content-save"
              mode="contained" 
              theme={theme}
              onPress={() => navigation.goBack()}>
                  Cancel
             </Button>
             
     
     </ScrollView>
             
             
      </View>
     
     
 
    )
}

